import React, { Component } from 'react';
import Modal from 'layouts/list_modal';
import Tabel from 'layouts/tabel';
import Scroll from 'simplebar-react';

export default class listContact extends Component {
    render() {
        let { mode , modal , title , users } = this.props;

        return (
            <Modal mode={mode} modal={modal} title={title}>
                <Scroll>
                    <Tabel 
                        keyField={'ID_FILE'}
                        data={users}
                        columns={[
                                    {
                                        dataField:'DTUPLOAD',
                                        text:'Tanggal Upload'
                                    },
                                    {
                                        dataField:'ID_FILE',
                                        text:'Action',
                                        formatter: this.action
                                    }
                                ]}

                    width={{width:'300px'}}
                                
                    />
                </Scroll>                               
            </Modal>
        )
    }
}
